🇪🇸Este fin de semana he comenzado este juego 🏀 NBA 2KPlaygrounds2 y me está encantando,  controles simple,  nivel de aprendizaje muy acertado.  Y el tema de conseguir los jugadores a través de sobres y que estos se puedan mejorar jugando con ellos y completando los desafíos de cada uno me parece genial.  El inconveniente que he dejado Fallout 76, demasiado vacío y aburrido.  Jugaba una hora y no había echo más que andar y andar. ¿Con que juego estáis ahora,  que juego habéis dejado de lado últimamente? 🎮 Buena semana chic@s!!! 😁
_______________
🇺🇸This weekend I started this game 🏀 NBA 2KPlaygrounds2 and I love it, simple controls, very successful learning level. And the issue of getting players through envelopes and that these can be improved by playing with them and completing each other's challenges seems great to me. The inconvenience I've left Fallout 76, too empty and boring. I played an hour and had done nothing but walk and walk. What game are you with now, what game have you left out lately? 🎮 Good week friends !!! 😁
